import './App.css';

function App() {
  return (
    <div className="App">
      <div className="login">
        <h1>Login !!</h1>
        <input type="text" placeholder="Email"/>
        <input type="password" placeholder="Password" />
        <button type="submit">Login</button>
      </div>
    </div>
  );
}

export default App;
